    return (
      <Base title="home page">
        <div className="row">
          <div className="col-4">
            <Card />
          </div>
          <div className="col-4">
            <button>test</button>
          </div>
          <div className="col-4 ">
            <button>test</button>
          </div>
        </div>
      </Base>
    );
}
export default Home;
